public class InnerDataSourceServiceNowConfigurationFactory(Action<Humidifier.Kendra.DataSourceTypes.ServiceNowConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.DataSourceTypes.ServiceNowConfiguration>
{

    internal InnerDataSourceServiceNowServiceCatalogConfigurationFactory ServiceCatalogConfigurationFactory { get; set; }

    internal InnerDataSourceServiceNowKnowledgeArticleConfigurationFactory KnowledgeArticleConfigurationFactory { get; set; }

    protected override Humidifier.Kendra.DataSourceTypes.ServiceNowConfiguration Create()
    {
        var serviceNowConfigurationResult = CreateServiceNowConfiguration();
        factoryAction?.Invoke(serviceNowConfigurationResult);

        return serviceNowConfigurationResult;
    }

    private Humidifier.Kendra.DataSourceTypes.ServiceNowConfiguration CreateServiceNowConfiguration()
    {
        var serviceNowConfigurationResult = new Humidifier.Kendra.DataSourceTypes.ServiceNowConfiguration();

        return serviceNowConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Kendra.DataSourceTypes.ServiceNowConfiguration result)
    {
        base.CreateChildren(result);

        result.ServiceCatalogConfiguration ??= ServiceCatalogConfigurationFactory?.Build();
        result.KnowledgeArticleConfiguration ??= KnowledgeArticleConfigurationFactory?.Build();
    }

} // End Of Class

